  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Charles
  M. Russell NWR (including the satellite refuges) outlines Refuge accomplishments
  during the 1972 calendar year. The report begins by summarizing the weather conditions,
  habitat conditions, water conditions, and food and cover conditions during the year.
  Wildlife- including migratory birds, upland game birds, big game animals, predators,
  rodents, and raptors- is also covered. The Refuge development and maintenance section
  discusses plantings and vegetation control. Resource management is outlined; topics
  include grazing, haying, fur harvesting, timber removal, and commercial fishing.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes hunting, fishing, and safety.
  Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
